import{_ as n,j as i,o as t,v as h}from"./chunks/framework.OlxNbC8G.js";const c=JSON.parse('{"title":"Giới thiệu","description":"","frontmatter":{"footer":true,"outline":false,"date":"2024-01-08T00:00:00.000Z"},"headers":[{"level":1,"title":"Giới thiệu","slug":"gioi-thieu","link":"#gioi-thieu","children":[]}],"relativePath":"blog/gioi-thieu.md","filePath":"blog/gioi-thieu.md","lastUpdated":1705589516000}'),g={name:"blog/gioi-thieu.md"},e=[h('<h1 id="gioi-thieu" tabindex="-1">Giới thiệu <a class="header-anchor" href="#gioi-thieu" aria-label="Permalink to &quot;Giới thiệu {#gioi-thieu}&quot;">​</a></h1><p>Xin chào mọi người,</p><p>Tôi là Thành, một nhà phát triển phần mềm đang công tác tại <a href="https://vietnamdevcenter.linecorp.com/en" target="_blank" rel="noreferrer"><strong>Line Technology Viet Nam</strong></a>. Hôm nay, tôi rất vui khi bạn lần đầu đến blog cá nhân của mình, nơi tôi không chỉ truyền đạt kiến thức về lập trình mà còn sử dụng như một nơi để ghi chú và học hỏi.</p><p>Mục đích chính của blog này là tạo ra một không gian chia sẻ kiến thức lập trình. Tôi tin rằng việc chia sẻ thông tin sẽ giúp cộng đồng phát triển và tiến bộ. Bạn sẽ không chỉ tìm thấy các bài viết hữu ích về lập trình mà còn có cơ hội viết và đóng góp các bài viết.</p><p>Đây cũng là nơi tôi tự thách thức bản thân và không ngừng học hỏi. Mỗi bài viết không chỉ là cơ hội để chia sẻ kiến thức mà còn là cơ hội để tôi tự nắm vững và hiểu sâu hơn về những vấn đề liên quan đến ngành công nghiệp phần mềm.</p><p>Tôi hy vọng rằng các độc giả thân mến sẽ thấy thú vị và hữu ích khi đọc blog của mình. Sự góp ý từ các bạn là nguồn động viên quý báu, giúp tôi liên tục cải tiến và đáp ứng tốt hơn nhu cầu của cộng đồng.</p><p>Đừng ngần ngại chia sẻ ý kiến, đặt câu hỏi hoặc đề xuất các chủ đề bạn muốn tôi bàn luận. Tôi rất mong được sự đóng góp chân thành từ phía các bạn.</p><p>Cảm ơn bạn đã dành thời gian ghé thăm blog của tôi. Hy vọng rằng nó sẽ trở thành một nguồn thông tin hữu ích và đáng tin cậy đối với cộng đồng lập trình.</p><p>Chân thành.</p><p>Thành</p>',10)];const a=n(g,[["render",function(n,h,c,g,a,r){return t(),i("div",null,e)}]]);export{c as __pageData,a as default};
